function [fitresult, gof] = createFit2gaus(aa2, aa3)
%CREATEFIT(AA2,AA3)
%  Create a fit.
%
%  Data for 'untitled fit 1' fit:
%      X Input : aa2
%      Y Output: aa3
%  Output:
%      fitresult : a fit object representing the fit.
